First they done dropped more than 10 of the livest DVD magazines from the South, capturing the South so trill that they had to branch out and start eating off other DVD magazines' plates. Now they're hood-wide, taking HOOD AFFAIRS DVD to every stretch of the U.S. you can think of to cover your favorite rap artists in their own element.

One of their biggest projects to date, if not their biggeest, is their &quot;TRAP-A-HOLIC&quot; DVD that helped launch the Gucci Mane street movement that took over in 2007 and continued into 2008. Featuring Gucci in his rawest element (at home with his people), HOOD AFFAIRS brought you behind the scenes of one of the rap game's fastest up-and-comers.

Then Gucci blew up, and now you see his music everywhere in the hood. Now it's OJ DA JUICEMAN's turn.

OJ Da Juiceman &amp; Hood Affairs team up to bring you &quot;Got Juice?&quot; The DVD. This DVD documents OJ's start from hustling in the streets to where's he's at now: hustling in the rap game alongside some of the South's finest. His hustle in the rap game has brought him major underground recognition with his many mixtapes in the streets. Now get to know the man behind the music. OJ DA JUICE takes you to the hood where he was raised and hustled before his success with rap.
